column1:
nmcli can accepts both direct JSON configuration data and a file name containing the configuration. In the latter case the file is read and the contents is put into this property.

Examples: set team.config { "device": "team0", "runner": {"name": "roundrobin"}, "ports": {"eth1": {}, "eth2": {}} }
          set team.config /etc/my-team.conf

column3:
നേരിട്ടുള്ള ജെഎസ്ഒഎന്‍ ക്രമീകരണ ഡേറ്റയും ക്രമീകരണമടങ്ങുന്ന ഫയല്‍ നാമവും nmcli-നു് സ്വീകരിയ്ക്കാം. ഫയല്‍ നാമമാണെങ്കില്‍, ഫയല്‍ വായിച്ചു് ഇതിലേക്കു് വിവരങ്ങള്‍ ശരിയായി സൂക്ഷിയ്ക്കുന്നു.

ഉദാഹരണങ്ങള്‍: set team.config { "device": "team0", "runner": {"name": "roundrobin"}, "ports": {"eth1": {}, "eth2": {}} }
          set team.config /etc/my-team.conf

column1:
Usage: nmcli general { COMMAND | help }

COMMAND := { status | hostname | permissions | logging }

  status

  hostname [<hostname>]

  permissions

  logging [level <log level>] [domains <log domains>]

column3:
ഉപയോഗിയ്ക്കേണ്ട വിധം: nmcli general { COMMAND | help }

COMMAND := { status | hostname | permissions | logging }

  status

  hostname [<hostname>]

  permissions

  logging [level <log level>] [domains <log domains>]

column1:
Usage: nmcli general status { help }

Show overall status of NetworkManager.
'status' is the default action, which means 'nmcli gen' calls 'nmcli gen status'

column3:
ഉപയോഗിയ്ക്കേണ്ട വിധം: nmcli general status { help }

നെറ്റ്‌വര്‍ക്ക്മാനേജറിന്റെ മൊത്തം അവസ്ഥ കാണിയ്ക്കുന്നു.
'status' - സ്വതവേയുള്ള പ്രവര്‍ത്തി. അതിനര്‍ത്ഥം, 'nmcli gen',  'nmcli gen status'-നെലഭ്യമാക്കുന്നു

column1:
Usage: nmcli networking { COMMAND | help }

COMMAND := { [ on | off | connectivity ] }

  on

  off

  connectivity [check]

column3:
ഉപയോഗിയ്ക്കേണ്ട വിധം: nmcli networking { COMMAND | help }

COMMAND := { [ on | off | connectivity ] }

  on

  off

  connectivity [check]

column1:
Usage: nmcli radio all { ARGUMENTS | help }

ARGUMENTS := [on | off]

Get status of all radio switches, or turn them on/off.

column3:
ഉപയോഗിയ്ക്കേണ്ട വിധം: nmcli radio all { ARGUMENTS | help }

ARGUMENTS := [on | off]

എല്ലാ റേഡിയോ സ്വിച്ചുകളുടേയും അവസ്ഥ ലഭ്യമാക്കുക അല്ലെങ്കില്‍ ഓണ്‍/ഓഫ് ചെയ്യുക.

column1:
Usage: nmcli radio wifi { ARGUMENTS | help }

ARGUMENTS := [on | off]

Get status of Wi-Fi radio switch, or turn it on/off.

column3:
ഉപയോഗിയ്ക്കേണ്ട വിധം: nmcli radio wifi { ARGUMENTS | help }

ARGUMENTS := [on | off]

വൈഫൈ റേഡിയോ സ്വിച്ചിന്റെ അവസ്ഥ ലഭ്യമാക്കുക അല്ലെങ്കില്‍ ഓണ്‍/ഓഫ് ചെയ്യുക.

column1:
Usage: nmcli radio wwan { ARGUMENTS | help }

ARGUMENTS := [on | off]

Get status of mobile broadband radio switch, or turn it on/off.

column3:
ഉപയോഗിയ്ക്കേണ്ട വിധം: nmcli radio wwan { ARGUMENTS | help }

ARGUMENTS := [on | off]

മൊബൈല്‍ ബ്രോഡ്ബാന്‍ഡ് സ്വിച്ചിന്റെ അവസ്ഥ ലഭ്യമാക്കുക അല്ലെങ്കില്‍ ഓണ്‍/ഓഫ് ചെയ്യുക.
